'use strict'

console.time('Build database time');
window.database = {
  listTrackNewest: [],
  listTrack: [],
  listCode: [],
  listCv: [],
  listTag: [],
  listSeries: [],
}
let addTrack = (code, rjCode, cvs, tags, series, engName, japName, thumbnail, images, audios)=>{
  cvs = (cvs.trim().replaceAll(/\s*,\s*/g, ",")).split(",").sort()
  tags = (tags.trim().replaceAll(/\s*,\s*/g, ",")).split(",").sort()
  series = series.replaceAll('\'', '’').replaceAll('"', '”')
  engName = engName.replaceAll('\'', '’').replaceAll('"', '”')
  japName = japName.replaceAll('\'', '’').replaceAll('"', '”')
  images = images ? (images.trim().replaceAll(/\s*,\s*/g, ",")).split(",") : []
  audios = audios ? (audios.trim().replaceAll(/\s*,\s*/g, ",")).split(",") : []
  let track = new window.classes.Track(
    code, rjCode, cvs, tags, series, engName, japName, thumbnail, images, audios
  )
  window.database.listTrackNewest.push(track)
  window.database.listCode.push(code)
  cvs.forEach((cv)=>{
    if(!cv)
      return
    let indexOfCv = window.database.listCv.findIndex(cvToFind => cvToFind.name == cv);
    if(indexOfCv == -1) {
      window.database.listCv.push(new window.classes.Cv(cv, 1))
    } else {
      window.database.listCv[indexOfCv].count++
    }
  })
  tags.forEach((tag)=>{
    if(!tag)
      return
    let indexOfTag = window.database.listTag.findIndex(tagToFind => tagToFind.name == tag);
    if(indexOfTag == -1) {
      window.database.listTag.push(new window.classes.Tag(tag, 1))
    } else {
      window.database.listTag[indexOfTag].count++
    }    
  })
  if(series) {
    let indexOfSeries = window.database.listSeries.findIndex(s => s.name == series);
    if(indexOfSeries == -1) {
      window.database.listSeries.push(new window.classes.Series(series, 1))
    } else {
      window.database.listSeries[indexOfSeries].count++
    }
  }
}

